DROP TABLE IF EXISTS tutores;

CREATE TABLE `tutores` (
  `idTutores` int(11) NOT NULL AUTO_INCREMENT,
  `nombres_mama` varchar(45) NOT NULL,
  `nombres_papa` varchar(45) NOT NULL,
  `apellidos_mama` varchar(45) NOT NULL,
  `apellidos_papa` varchar(45) NOT NULL,
  `telefono1` varchar(8) NOT NULL,
  `celular1` varchar(8) NOT NULL,
  `telefono2` varchar(8) DEFAULT NULL,
  `celular2` varchar(8) DEFAULT NULL,
  `Direccion2` varchar(45) DEFAULT NULL,
  `Direccion1` varchar(45) NOT NULL,
  `email1` varchar(45) DEFAULT NULL,
  `email2` varchar(45) DEFAULT NULL,
  `idestudiante` int(11) NOT NULL,
  `monto_pagar` varchar(45) NOT NULL,
  `Estudiantes_idEstudiantes` int(11) NOT NULL,
  `Profesores_idProfesores` int(11) NOT NULL,
  PRIMARY KEY (`idTutores`),
  UNIQUE KEY `idestudiante_UNIQUE` (`idestudiante`),
  KEY `fk_Tutores_Estudiantes1_idx` (`Estudiantes_idEstudiantes`),
  KEY `fk_Tutores_Profesores1_idx` (`Profesores_idProfesores`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



